import { Field } from '@progress/kendo-react-form';
import { FormInput, FormUpload } from './FormComponents';
import { userNameValidator, emailValidator, passwordValidator } from './Validators';
import { RadioGroup } from '@progress/kendo-react-inputs';
export const NameAndRegion = <div>
    <Field key={'vpsName'} id={'vpsName'} name={'vpsName'} label={'Name of the VPS'} component={FormInput} validator={userNameValidator} />
    <Field key={'region'} id={'region'} name={'region'} label={'Heycloud Region'} component={RadioGroup} validator={userNameValidator} />
  </div>;
